  \"2013-03-14T15:11:03.903469\",\n\t\"name\": \"2009-saline-county-geotiff-tiles\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"One foot ground resolution, natural color
  (RGB), 8-bit digital orthophotography for Saline County, Arkansas. The imagery was
  collected using the Leica Geosystems ADS40 sensor between February 5th and March
  6th, 2009 at an average altitude of 9,600 feet above ground level. The National
  Elevation Dataset (NED) was used as vertical control. Airborne GPS/IMU data was
  used as horizontal control. The imagery was produced by Pixxures, Inc. under contract
  for DigitalGlobe, Inc.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
